// CSS import
import styles from '../styles/Nav.module.css';

const Nav = () => {
  return (
    <div className={styles.Nav}>
      <ul>
        <li className={styles.option}>영화/TV</li>
      </ul>
    </div>
  )
};

export default Nav;
